"""### **Reduo de dimensionalidade**

O objetivo dessa seo  transformar nossos dados de experimentos em menos colunas usando da Anlise de Componentes Principais (Principal Componentes Analysis ou PCA). O PCA  explicado por Bruce e Bruce (2019, p. 259): 


> "A ideia de PCA  combinar mltiplas variveis preditoras numricas em um conjunto menor de variveis, que so combinaes lineares ponderadas do conjunto original. O menor conteudo de variveis, os *componentes principais*, 'explica' a maior parte da variabilidade do conjunto completo de variveis, reduzindo a dimenso dos dados."

Em resumo, PCA  uma tcnica estatstica para diminuir a complexidade dos dados, mas preservando o mximo de informao importante. Com isso podemos obter um modelo com menos ruido, que no demore em demasia para ser treinado e testado (o que seria invivel se ele utilizasse todos os dados disponveis) e que possa fazer previses melhores que o modelo "burro".  
"""

# Vamos tentar reduzir de mais 800 colunas para 100 e ver a varincia explicada
pca = PCA(n_components = 50, random_state= 2)

# Precisamos ajustar os dados de treino ao PCA
pca.fit(x_treino.drop("id", axis = 1))

# Vamos ver o quanto da varincia observada o PCA explica.
pca.explained_variance_ratio_.sum()

# Podemos visualizar tambm a varincia explicada em um grfico de linha.

plt.figure(figsize = (10,10))
sns.lineplot(x = range(1,51), y = pca.explained_variance_ratio_)
plt.title("Varincia explicada por 50 componentes principais", fontsize = 14, weight = "bold")
plt.xlabel("PCA", fontsize = 12)
plt.ylabel("Varincia explicada", fontsize = 12)

# Precisamos transformar os nossos dados antes de treinar e testar o modelo.
# Comeando pelo dados de treino
pca_xtreino = pca.transform(x_treino.drop("id", axis = 1))
x_treino = x_treino.filter(["id"])
x_treino = pd.concat([x_treino, pd.DataFrame(pca_xtreino, index = x_treino.index)], axis = 1, ignore_index= False)

# Passando para os dados de validao
pca_xval = pca.transform(x_val.drop("id", axis = 1))
x_val = x_val.filter(["id"])
x_val = pd.concat([x_val, pd.DataFrame(pca_xval, index = x_val.index)], axis = 1, ignore_index= False)

# Finalmente chegando nos dados de teste
pca_xteste = pca.transform(x_teste.drop("id", axis = 1))
x_teste = x_teste.filter(["id"])
x_teste = pd.concat([x_teste, pd.DataFrame(pca_xteste, index = x_teste.index)], axis = 1, ignore_index= False)

